INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ペコリーヌとの出会い", 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, 1, 2, 0, 7, 0, 91002, "フリーマーケット会場", "青空の下で謁見", 10118, 40, 2834);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("マホとの出会い", 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, 1, 2, 0, 7, 0, 91002, "フリーマーケット会場", "未来の騎空団\nマスコット？", 10118, 40, 2835);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("アキノとの出会い", 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, 1, 2, 0, 7, 0, 91002, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 10118, 40, 2837);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ジュンとの出会い", 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, 1, 2, 0, 18, 0, 91002, "フリーマーケット会場", "黄金色の悩みごと", 10118, 40, 4108402);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("カオリとの出会い", 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, 1, 2, 0, 18, 0, 91002, "フリーマーケット会場", "白熱！　格闘大会！", 10118, 40, 4107402);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ニノンとの出会い", 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, 1, 2, 1, 16, 0, 91002, "オーエド町", "祭り太鼓はオーエドの華", 10118, 40, 9000227);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("スズナとの出会い", 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, 1, 3, 0, 19, 0, 91002, "フリーマーケット会場", "人気者は遅れて\nやってくる", 10118, 40, 2101181);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ナナカとの出会い", 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, 1, 3, 0, 18, 0, 91002, "ランドソル市街地", "巫女・ミーツ・魔法少女", 10118, 40, 4109402);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("キャル＆コッコロとの出会い", 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, 1, 3, 0, 18, 0, 91002, "フリーマーケット会場", "ネズ耳は二度なくなる", 10118, 40, 4305402);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("ユカリとの出会い", 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, 1, 3, 0, 18, 0, 91002, "ランドソル市街地", "この出会いにカンパイ！", 10118, 40, 4101402);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("アオイとの出会い", 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, 1, 3, 0, 18, 0, 91002, "ランドソル市街地", "陰陽アンサンブル", 10118, 40, 4106402);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("シノブとの出会い", 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, 1, 3, 1, 7, 0, 91002, "フリーマーケット会場", "運試し十番勝負！", 10118, 40, 2836);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES ("オープニング", 5118600, 0, 0, 0, 1, 0, 0, 10145115, 0, 0, "彼女たちの新たな日常", 10118, 0, 0);
